import './App.css';
import React from 'react';

function App() {
  return (
    <div class="text-center text-white p-4 font-b text-2xl font-bold">
      <h1 class="mt-16 mr-52 text-white p-4 font-b text-center text-5xl font-bold">CREER UN COMTE</h1>
      <form>
      <label class="mt-16 mr-96 ">Email</label> <br />
      <input class="focus:outline-none w-3/5 bg-transparent rounded-full border border-2 border-cyan-300 text-ms" type="text" name="name" /><br />
      <label className="mt-16 mr-87"> mot de passe</label> <br />
      <input class="mt-16 focus:outline-none w-3/5 bg-transparent rounded-full border border-2 border-cyan-300 text-ms" type="password" /><br />
      <input className="mt-16" type="submit" value="Submit" />
      </form>        
    </div>
  );
}

export default App;
